import React from 'react';

import { NavLink } from 'react-router-dom';
import '../../css/navigation.css';
import '../../css/hamburger.css';

function toggleNav() {
  let navLeft = document.getElementById("navbar").style.left;
  document.getElementById("navbar").style.left = (navLeft === "0px") ? "-170.5px" : "0px";
  document.getElementById("navbarOpenClose").classList.toggle("is-active");
}

const Navigation = () => {
  return (
    <div id="navbar" className="navbar">
      <NavLink to="/" className="button noselect navbarButton">Home</NavLink>
      <NavLink to="/about" className="button noselect navbarButton">About / How to play</NavLink>
      <NavLink to="/contact" className="button noselect navbarButton">Contact</NavLink>
      <NavLink to="/designer" className="button noselect navbarButton">Designer</NavLink>
      <NavLink to="/play" className="button noselect navbarButton">Play Online</NavLink>
      <NavLink to="/purchase" className="button noselect navbarButton">Purchase</NavLink>
      <button id="navbarOpenClose" class="hamburger hamburger--slider navbarOpenClose" onClick={toggleNav} type="button">
        <span class="hamburger-box">
          <span class="hamburger-inner"></span>
        </span>
      </button>
    </div>
  );
}

export default Navigation;
